package vn.edu.iuh.fit.entity;import jakarta.persistence.*;import lombok.*;import vn.edu.iuh.fit.enums.ParticipantType;@Entity@Table(name = "tickets")@Getter@Setter@NoArgsConstructor@AllArgsConstructorpublic class Ticket {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long ticketId;    @ManyToOne    @JoinColumn(name = "booking_id", referencedColumnName = "bookingId", nullable = false)    private Booking booking;    @Enumerated(EnumType.STRING)    private ParticipantType participantType;}